import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';
import addHeroLogo from '../../assets/add-hero-logo.png';

const Home = () => {
  const superherosList = [];

  return (
    <section
      style={{ height: '100vh' }}
      className='d-flex mt-5 justify-content-center'
    >
      <div
        class='d-flex flex-column align-items-center alert alert-primary w-50 h-50 p-3'
        role='alert'
      >
        <p className='fs-3 text-center text-secondary mt-5'>
          Your team is empty, you can start adding superheros here
        </p>
        <Link className='p-6 text-center mt-5'>
          <img
            alt='add a hero to the team icon'
            src={addHeroLogo}
            className='w-25'
          ></img>
        </Link>
      </div>

      {superherosList.length > 0 && (
        <div className='container bg-primary h-75 mt-5 rounded'>CARDS</div>
      )}
    </section>
  );
};

export default Home;
